import React from 'react';

import { Container, Column } from './styles';
import Card from '../Card';

function List({ title }) {
  return (
    <>
      <Column>
        <Container>

          <header>
            <h2>{title}</h2>

            <ul>

              <Card data={'Victor '} pontuation={114} />
              <Card data={'Eric '} pontuation={90} />
              <Card data={'Vinicius '} pontuation={70} />
              <Card data={'Pamela'} pontuation={57} />
              <Card data={'Niedson '} pontuation={41} />
              <Card data={'Felipe '} pontuation={20} />
              <Card data={'Juliana'} pontuation={19} />
              <Card data={'Luana'} pontuation={16} />
              <Card data={'Diogo S'} pontuation={1} />

            </ul>
          </header>

        </Container>
      </Column>
    </>
  );
}

export default List;
